(6, 'Profil bearbeiten', 'Register / Log In', 'Anmeldung erfolgreich.', '<p>Dies ist die \"Profil bearbeiten\" Seite</p>', NULL, '<p>Danke für die Anmeldung!</p>', 1, 0, 1, 0, 0, 0, 'Validation', 'office@streunerkatzen.org', 'Kontoaktivierung $SiteName', '<p>\r\n	Liebe/r $Member.FirstName,\r\n</p>\r\n\r\n<p>\r\n	Danke für Deine Anmeldung bei $SiteName! Um dein Konto benutzen zu können, bitte aktiviere vorher deine Emailadresse, indem Du den folgenden Link anklickst. Vorher ist es Dir nicht möglich, Katzenanzeigen zu erstellen.\r\n</p>\r\n\r\n<h3>Kontoaktivierung</h3>\r\n\r\n<p>\r\n	Bitte <a href=\"$ConfirmLink\">aktiviere Deine Emailadresse</a>, oder öffne den folgenden Link in Deinem Browser:\r\n</p>\r\n\r\n<pre>$ConfirmLink</pre>\r\n\r\n<p>\r\n	Wenn Du nicht die Person bist, die sich mit dieser Emailadresse registriert hat, bitte ignoriere diese Email. Das entsprechende Nutzerkonto wird nicht aktiviert.\r\n</p>\r\n\r\n<h3>Log-In Details</h3>\r\n\r\n<p>\r\n	Sobald Dein Konto aktiviert wurde wirst Du automatisch eingeloggt. Du kannst Dich außerdem mit einem Klick auf der <a href=\"$LoginLink\">Login-Seite</a> einloggen. Solltest Du Dein Passwort vergessen haben, kannst Du auf der <a href=\"$LostPasswordLink\">Passwort verloren-Seite</a> ein neues anfordern.\r\n</p>\r\n', 'Konto aktiviert', '<p>Dein Konto ist nun aktiv, und Du wurdest eingeloggt. Vielen Dank!</p>', 0);
