(17, 6, 7, 0, 0, 1, 1, 0, 'Symbiote\\MemberProfiles\\Pages\\MemberProfilePage', '2019-01-16 20:09:43', '2019-01-14 20:35:50', 'Inherit', 'Inherit', 'profil', 'Profil', NULL, NULL, NULL, NULL, 1, 1, 6, 0, 0, NULL, 0),
(18, 6, 8, 1, 0, 1, 1, 1, 'Symbiote\\MemberProfiles\\Pages\\MemberProfilePage', '2019-01-16 20:09:58', '2019-01-14 20:35:50', 'Inherit', 'Inherit', 'profil', 'Profil', NULL, NULL, NULL, NULL, 1, 1, 6, 0, 0, NULL, 0),
(19, 7, 1, 0, 0, 1, 1, 0, 'Page', '2019-01-16 20:12:53', '2019-01-16 20:12:53', 'Inherit', 'Inherit', 'neue-page', 'Neue Page', NULL, NULL, NULL, NULL, 1, 1, 7, 0, 0, NULL, 0),
(20, 7, 2, 0, 0, 1, 1, 0, 'Page', '2019-01-16 20:15:48', '2019-01-16 20:12:53', 'Inherit', 'Inherit', 'verein', 'Verein', NULL, '<h2>Über uns</h2><p>Der Verein \"Streunerkatzen OÖ - Verein zum Schutz verwilderter Katzen\" wurde am 17.08.2006 gegründet.</p><p>Streunerkatzen sind für viele Menschen wie Ratten oder Tauben, sprich Ungeziefer und somit nicht erwünscht. Die meisten Katzen jedoch stammen vorwiegend von Bauernhöfen oder ausgesetzten, unkastrierten Katzen ab.<br>Man findet sie überall: im ländlichen Bereich genauso wie mitten in den Städten.</p><p>Leider geht es den meisten verwilderten Katzen nicht gut. Sie leben unter den widrigsten Bedingungen und müssen sich im kalten Winter durchschlagen. Neben natürlichen Feinden wie Marder, Hunde, etc.. kommen natürlich auch noch die Menschen, die die Katzen entweder \"nur\" verjagen, misshandeln oder gar töten.</p><p>Das Hauptziel des Vereines ist es diesen Katzen zu helfen. Wir klären über die Entstehung dieser wilden Katzenpopulation auf. Es werden Einfang- und Kastrationsaktionen durchgeführt, Futterstellen eingerichtet und den Katzen Unterschlupfmöglichkeiten bereitgestellt. Unter diesen Bedingungen (Kastration, regelmässiges Futter und trockener und im Winter vor allem warmer Unterschlupf) führen diese Katzen ein relativ glückliches Leben.</p><p>Natürlich genügt es nicht nur die bereits draussen lebenden Streuner zu kastrieren sondern auch die Menschen davon zu überzeugen auch ihre zutraulichen \"Haus\"katzen zu kastrieren. Wie oft kommt es vor, dass eine Katze, die Besitzer hat, sich in einen Schuppen zurückzieht und dort ihre Babies bekommt und diese aufzieht. Die Kleinen sind Menschen nicht gewohnt und folgen zum Teil gar nicht der Mutter ins \"warme\" zu Hause, sondern gehen bald ihre eigenen Wege und pflanzen sich wiederum fort.</p><p><strong>Jeder, der seine unkastrierte Katze draussen frei herumlaufen lässt, trägt zur Entstehung oder Vergrößerung der verwilderten Katzenpopulationen bei!</strong></p><h2>Team</h2><p>teamfotos und so...</p><h2>Statistik</h2><p>ganz viele zahlen...</p>', NULL, NULL, 1, 1, 7, 0, 0, NULL, 0),
(21, 7, 3, 0, 0, 1, 1, 0, 'Streunerkatzen\\PlainPage', '2019-02-10 13:28:10', '2019-01-16 20:12:53', 'Inherit', 'Inherit', 'verein', 'Verein', NULL, '<h2>Über uns</h2><p>Der Verein \"Streunerkatzen OÖ - Verein zum Schutz verwilderter Katzen\" wurde am 17.08.2006 gegründet.</p><p>Streunerkatzen sind für viele Menschen wie Ratten oder Tauben, sprich Ungeziefer und somit nicht erwünscht. Die meisten Katzen jedoch stammen vorwiegend von Bauernhöfen oder ausgesetzten, unkastrierten Katzen ab.<br>Man findet sie überall: im ländlichen Bereich genauso wie mitten in den Städten.</p><p>Leider geht es den meisten verwilderten Katzen nicht gut. Sie leben unter den widrigsten Bedingungen und müssen sich im kalten Winter durchschlagen. Neben natürlichen Feinden wie Marder, Hunde, etc.. kommen natürlich auch noch die Menschen, die die Katzen entweder \"nur\" verjagen, misshandeln oder gar töten.</p><p>Das Hauptziel des Vereines ist es diesen Katzen zu helfen. Wir klären über die Entstehung dieser wilden Katzenpopulation auf. Es werden Einfang- und Kastrationsaktionen durchgeführt, Futterstellen eingerichtet und den Katzen Unterschlupfmöglichkeiten bereitgestellt. Unter diesen Bedingungen (Kastration, regelmässiges Futter und trockener und im Winter vor allem warmer Unterschlupf) führen diese Katzen ein relativ glückliches Leben.</p><p>Natürlich genügt es nicht nur die bereits draussen lebenden Streuner zu kastrieren sondern auch die Menschen davon zu überzeugen auch ihre zutraulichen \"Haus\"katzen zu kastrieren. Wie oft kommt es vor, dass eine Katze, die Besitzer hat, sich in einen Schuppen zurückzieht und dort ihre Babies bekommt und diese aufzieht. Die Kleinen sind Menschen nicht gewohnt und folgen zum Teil gar nicht der Mutter ins \"warme\" zu Hause, sondern gehen bald ihre eigenen Wege und pflanzen sich wiederum fort.</p><p><strong>Jeder, der seine unkastrierte Katze draussen frei herumlaufen lässt, trägt zur Entstehung oder Vergrößerung der verwilderten Katzenpopulationen bei!</strong></p><h2>Team</h2><p>teamfotos und so...</p><h2>Statistik</h2><p>ganz viele zahlen...</p>', NULL, NULL, 1, 1, 7, 0, 0, NULL, 0),
(22, 7, 4, 1, 0, 1, 1, 1, 'Streunerkatzen\\PlainPage', '2019-02-10 13:29:53', '2019-01-16 20:12:53', 'Inherit', 'Inherit', 'verein', 'Verein', NULL, '<h2>Über uns</h2><p>Der Verein \"Streunerkatzen OÖ - Verein zum Schutz verwilderter Katzen\" wurde am 17.08.2006 gegründet.</p><p>Streunerkatzen sind für viele Menschen wie Ratten oder Tauben, sprich Ungeziefer und somit nicht erwünscht. Die meisten Katzen jedoch stammen vorwiegend von Bauernhöfen oder ausgesetzten, unkastrierten Katzen ab.<br>Man findet sie überall: im ländlichen Bereich genauso wie mitten in den Städten.</p><p>Leider geht es den meisten verwilderten Katzen nicht gut. Sie leben unter den widrigsten Bedingungen und müssen sich im kalten Winter durchschlagen. Neben natürlichen Feinden wie Marder, Hunde, etc.. kommen natürlich auch noch die Menschen, die die Katzen entweder \"nur\" verjagen, misshandeln oder gar töten.</p><p>Das Hauptziel des Vereines ist es diesen Katzen zu helfen. Wir klären über die Entstehung dieser wilden Katzenpopulation auf. Es werden Einfang- und Kastrationsaktionen durchgeführt, Futterstellen eingerichtet und den Katzen Unterschlupfmöglichkeiten bereitgestellt. Unter diesen Bedingungen (Kastration, regelmässiges Futter und trockener und im Winter vor allem warmer Unterschlupf) führen diese Katzen ein relativ glückliches Leben.</p><p>Natürlich genügt es nicht nur die bereits draussen lebenden Streuner zu kastrieren sondern auch die Menschen davon zu überzeugen auch ihre zutraulichen \"Haus\"katzen zu kastrieren. Wie oft kommt es vor, dass eine Katze, die Besitzer hat, sich in einen Schuppen zurückzieht und dort ihre Babies bekommt und diese aufzieht. Die Kleinen sind Menschen nicht gewohnt und folgen zum Teil gar nicht der Mutter ins \"warme\" zu Hause, sondern gehen bald ihre eigenen Wege und pflanzen sich wiederum fort.</p><p><strong>Jeder, der seine unkastrierte Katze draussen frei herumlaufen lässt, trägt zur Entstehung oder Vergrößerung der verwilderten Katzenpopulationen bei!</strong></p><h2>Team</h2><p>teamfotos und so...</p><h2>Statistik</h2><p>ganz viele zahlen...</p>', NULL, NULL, 1, 1, 7, 0, 0, NULL, 0),
